export default function NavBottom() {
  return (
    <div className="nav-links-bottom">
      <a href="">Skills</a>
      <a href="">About</a>
      <a href="">Contact</a>
      <style jsx>{`
        a,
        a:link {
          text-decoration: none;
          color: gray;
        }
        .nav-links-bottom {
          display: flex;
          justify-content: space-around;
          margin-top: 20px;
        }

        .nav-links-top a,
        .nav-links-bottom a {
          color: rgb(155, 152, 152);
          opacity: 0.5;
          position: relative;
        }
        .nav-links-top a:before,
        .nav-links-bottom a:before {
          content: "";
          position: absolute;
          width: 0;
          height: 2px;
          bottom: 0;
          right: 0;
          background-color: #fff;
          visibility: hidden;
          transition: all 0.3s ease-in-out;
        }
        .nav-links-top a:hover:before,
        .nav-links-bottom a:hover:before {
          visibility: visible;
          width: 100%;
        }
        .nav-links-top a:hover,
        .nav-links-bottom a:hover {
          transform: scale(1.3);
          opacity: 1;
        }
      `}</style>
    </div>
  );
}
